  false,\n\t\"url\": null,\n\t\"notes\": \"Denver Botanic Gardens undertook a floristic
  inventory of the Baca National Wildlife Refuge in 2012 and 2013 to build on Pam
  Regensbergu2019s 2006 inventory of the refuge. Our recent inventory combined with
  the earlier inventory (Regensberg 2007) should provide land managers a plant diversity
  baseline for the refuge. Regensberg (2007) provides thorough and detailed descriptions
  of climate, geology, soils, water resources and the vegetation communities on the
  refuge. Therefore, we will not repeat that information in this report but rather
  focus on areas of note or noteworthy species of particular interest based on recent
  field work. We also provide an updated species list available in multiple formats
  including an online checklist, which is the most valuable for helping identify species
  on the property.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
